polymer = ""

uniques = []
for letter in polymer:
    if letter.lower() not in uniques:
        uniques.append(letter)
uniques.sort()
reactants = []
for letter in uniques:
    reactants += [letter.upper()+letter.lower(), letter.lower()+letter.upper()]

def react(polymer):
    for test in reactants:
        f = polymer.find(test)
        if f >= 0:
            return(polymer[:f]+polymer[f+2:])
    return(None)

lengths = {}
for l in uniques:
    poly = list(polymer)
    i = 0
    while i < len(poly):
        if poly[i].lower() == l:
            poly.pop(i)
        else:
            i += 1
    poly = "".join(poly)
    while True:
        r = react(poly)
        if r is None:
            break
        else:
            poly = r
    lengths[l] = len(poly)

print(min(lengths.values()))
